= 4) +\n","  scale_fill_gradient(low = my_color[1], high = my_color[length(my_color)]) +\n","  geom_smooth(method = \"lm\", se = FALSE, color = \"#FF073A\") +\n","  #labs(title = \"Store Size vs. Sales per Square Foot\",\n","  #     subtitle = \"As the store expands, the inventory grows, yet the sales per \\nsquare foot diminishes.\",\n","  #     x = \"Store Area\",y = \"Sales per Square Foot\") +\n","  my_theme()\n","\n","# a contour graph indicating sales performance levels, showcasing sales per square foot versus sales area.\n","p2<-ggplot(stores, aes( x = Store_Area, y = Sales_Per_Sq_Ft, fill = ..level..)) +\n","stat_density_2d( geom = \"polygon\") + \n","scale_fill_gradient(low = my_color[length(my_color)], high =my_color[1] ) +\n","labs( x = \"Store Area\",y = \"Sales per Square Foot\") +\n","my_theme()\n","\n","#a heatmap showing daily customer count versus sales area and sales per square foot. \n","p3<-stores %>% \n","  select(Store_Area, Store_Sales, Daily_Customer_Count) %>%\n","  #group_by(Store_Area) %>% \n","  mutate(Store_Size = cut(Store_Area, breaks =  c(0, 1000, 1200, 1300, 1400, 1500,1600,1700, 1800, 1900,Inf), labels = c(\"<1000\",\"1000\", \"1200\" ,\"1300\", \"1400\", \"1500\",\"1600\", \"1700\", \"1800\",\">1900\"))) %>%\n","  mutate(Store_Profit = cut(Store_Sales, breaks =  c(14000, 20000, 25000, 30000,35000, 40000,45000, 50000, 55000,\n","                                                    60000, 65000, 70000, 75000, 80000, 85000, 90000,95000, 100000, 105000,\n","                                                   110000, 115000, 120000, 125000, 130000, 135000, 140000, 145000, Inf), \n","                                         labels = c(\"14k\", \"20k\", \"25k\", \"30k\",\"35k\", \"40k\",\"45k\" ,\"50k\", \"55k\",\n","                                                    \"60k\", \"65k\", \"70k\", \"75k\", \"80k\", \"85k\", \"90k\",\"95k\", \"100k\", \"105k\",\n","                                                   \"110k\", \"115k\", \"120k\", \"125k\", \"130k\", \"135k\", \"140k\", \"145k\")))%>% \n","  ggplot(mapping =  aes(x = Store_Profit ,y = Store_Size)) + \n","  geom_tile(    aes(\n","      width = 1,\n","      height = 1,\n","      fill = Daily_Customer_Count),colour=\"#000C18\", linewidth=0.25)+\n","  scale_fill_gradient(low = my_color[length(my_color)], high =my_color[1] ) +\n","  labs(title = \"Sizing Up Sales\\nExploring the Relationship between Store Area and Sales\", \n","       subtitle = \"Peeking into the Sales Landscape: Unveiling the Intricacies Hidden Insights where Size and Revenue Meet\\n to provide valuable insights into retail sales optimization\",\n","         x = \"Store Area\", y = \"Sales per Square Foot\") +  \n","      my_theme()\n","\n","options(repr.plot.width = 14, repr.plot.height = 9)\n","\n","plot<-ggdraw() +\n","  draw_plot(p1, x = 0, y = 0, width = 0.5, height = .5) +\n","  draw_plot(p2, x = 0.5, y = 0, width = 0.5, height = .5) +\n","  draw_plot(p3, x = 0, y = 0.5, width = 1, height = 0.5) +\n","  draw_plot_label(label = c(\"A\", \"B\", \"C\"), size = 15,\n","                  x = c(0, 0, 0.5), y = c(1, 1, 2))\n","plot\n"]},{"cell_type":"markdown","id":"6b3d8be3","metadata":{"papermill":{"duration":0.01705,"end_time":"2023-03-20T20:44:21.805632","exception":false,"start_time":"2023-03-20T20:44:21.788582","status":"completed"},"tags":[]},"source":["<a id=\"5\"></a>\n","# <p style=\"background-color:#001924;font-family:newtimeroman;color:#96C8BA;font-size:150%;text-align:center;border-radius:10px 10px;\">Conclusion </p> \n"," \n"," As the store area increases, it may become more difficult to maintain a consistent level of foot traffic and sales per square foot, leading to a decrease in sales efficiency. Additionally, larger stores may require more staff and resources to maintain, leading to higher operating costs that can negatively impact profitability. It's also possible that larger stores may be located in less desirable areas with lower foot traffic or face more competition from nearby stores, which can also negatively impact sales per square foot.\n"]},{"cell_type":"code","execution_count":null,"id":"add734cb","metadata":{"papermill":{"duration":0.016236,"end_time":"2023-03-20T20:44:21.838481","exception":false,"start_time":"2023-03-20T20:44:21.822245","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":27.273578,"end_time":"2023-03-20T20:44:21.978245","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-03-20T20:43:54.704667","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}